import React from "react";
import { mapIcon } from "../assets/icons/index";

function IconWithInfo(props) {
  return (
    <div className="flex">
      <img src={props.icon} alt="{props.icon}" />
      <p>{props.info}</p>
    </div>

  )

}

const ContactUs = () => {
  return (
    <div>
      <div className="flex w-full min-h-screen bg-primaryThree justify-center items-center">
        <div className="flex flex-col justify-between ">
          <div>
            <h1 className="font-[itim] text-4xl tracking-tight">Contact us</h1>
            <div>
              <IconWithInfo icon={mapIcon} i/>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
